import React, {Component} from 'react';
import './App.css';
import players from './playerData.js'
import {CardList} from './components/card-list/card-list.component'

class App extends Component {
  constructor(){
    super()
    this.state={
      players:players,
      searchField:''

    }
  }
  render() {
    return(
    <div className="App">
    <input type='search' placeholder='Search Player' onChange={e=>{this.setState({searchField:e.target.value},()=>console.log(this.state))}}/>
    <CardList players={this.state.players}/>
    </div>
    )
  }
}

export default App;
